import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import styled from 'styled-components';
import logo from '../logo.svg';


export default class Navbar extends Component {
	render() {
		return (

<nav class=" navbar-expand-lg p-3 mb-2 p-3 mb-2 bg-secondary text-white shadow-lg">
<div className="container">
<div className='row'>

<div className='col-sm-4'>
<Link to="/"> 
<img src={logo} alt='logo' className='navbar-brand image-tumbnail rounded-sm' />
</Link>
</div>

<div className='col-sm-8 pt-4'>
 <span class="align-baseline m-3 pt-5">Meet</span>
<span class="align-top m-3">My</span>
<span class="align-middle m-3">Friendly</span>
<span class="align-bottom m-3">Robots</span>
<span class="align-text-top m-3"></span>
<span class="align-text-bottom m-3">text-bottom</span>
  </div>

  </div>
</div> 
</nav>

		);
	}
}
